import { JeecgListMixin } from "@/mixins/JeecgListMixin";

export default {
  name: "LiveReport",
  mixins: [JeecgListMixin],

  data() {
    return {
      description: "直播间举报列表",
      columns: [
        {
          title: "举报人",
          align: "center",
          dataIndex: "nickName"
        },
        {
          title: "举报房间所属人",
          align: "center",
          dataIndex: "reportRoomName"
        },
        {
          title: "房间号",
          align: "center",
          dataIndex: "code"
        },
        {
          title: "举报原因",
          align: "center",
          dataIndex: "reason"
        },
        {
          title: "处理状态",
          align: "center",
          dataIndex: "state",
          customRender: function(text) {
            if (text == 0) {
              return "待处理";
            } else if (text == 1) {
              return "已处理";
            }
          }
        },
        {
          title: "创建时间",
          align: "center",
          dataIndex: "createTime"
        }
      ],
      url: {
        list: "/system/live/report/list"
      }
    };
  },

  methods: {}
};
